const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`There are several ways to troubleshoot your automated mobile app tests. Below are some common error messages and how to resolve them.`}</p>
    <h2 {...{
      "id": "abuse-job"
    }}>{`Abuse Job`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`Your job or account has been banned for abusing the Sauce Labs service.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <p>{`Sauce Labs takes measures to safeguard our price and performance for our paying customers, including termination of accounts we believe are not operating in good faith.`}</p>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <p>{`If you are a paying customer, please open a support ticket at `}<a parentName="p" {...{
        "href": "http://support.saucelabs.com/"
      }}>{`support.saucelabs.com`}</a>{` to request your ban be reviewed. Sauce Labs will not reverse abuse bans for Free or Open Sauce users.`}</p>
    <h2 {...{
      "id": "failed-to-download-mobile-application"
    }}>{`Failed to Download Mobile Application`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`The desired capabilities you've supplied include a URL to a mobile application to install and test. This may be a URL pointing to `}<a parentName="p" {...{
        "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
      }}>{`storage`}</a>{`, or a hosted app online. When we started your test, we were unable to correctly download a valid application from that URL. We may have been able to download something, but that something was not a valid application.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <ul>
      <li parentName="ul">{`You've specified an app hosted in `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
        }}>{`storage`}</a>{`, but there is nothing stored for your account with the given name`}</li>
      <li parentName="ul">{`You've specified an app hosted online, but the URL you've used can't be contacted by Sauce Labs`}</li>
      <li parentName="ul">{`You've specified an app hosted in your corporate network which can't be accessed via the Internet`}</li>
      <li parentName="ul">{`You're not providing the full path to the app file itself`}</li>
      <li parentName="ul">{`The site serving your application requires authentication`}</li>
    </ul>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <p>{`We recommend avoiding all problems with apps hosted internally by uploading `}<a parentName="p" {...{
        "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
      }}>{`storage`}</a>{` instead.`}</p>
    <p>{`If you're already using `}<a parentName="p" {...{
        "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
      }}>{`storage`}</a>{`, check:`}</p>
    <ul>
      <li parentName="ul">{`Your upload to `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
        }}>{`storage`}</a>{` has succeeded`}</li>
      <li parentName="ul">{`Your upload to `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=102721137"
        }}>{`storage`}</a>{` was within the last week, since Sauce Storage is cleaned out on a weekly basis`}</li>
      <li parentName="ul">{`Your uploaded app has the same MD5 hash as it does on your machine`}</li>
      <li parentName="ul">{`You're starting the `}<inlineCode parentName="li">{`app`}</inlineCode>{` desired capability with `}<inlineCode parentName="li">{`sauce-storage:`}</inlineCode>{`. There shouldn't be a leading `}<inlineCode parentName="li">{`http`}</inlineCode>{`.`}</li>
      <li parentName="ul">{`You're using the exact name you provided via the rest API, not the original filename. For example, if you uploaded a file named `}<inlineCode parentName="li">{`my_app.apk`}</inlineCode>{` to `}<inlineCode parentName="li">{`https://saucelabs.com/rest/v1/storage/YOUR_USERNAME/new_app_name.apk`}</inlineCode>{`, your file is available as `}<inlineCode parentName="li">{`sauce storage:new_app_name.apk`}</inlineCode>{`.`}</li>
    </ul>
    <h2 {...{
      "id": "internal-server-error"
    }}>{`Internal Server Error`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`This is a rare but known error. It indicates that the OnDemand portion of the Sauce Labs service lost its connection with the Virtual Machine running a test. Because the connection with the VM was lost, the details of the test (logs, video, metadata) will also be lost.  `}</p>
    <p>{`The error is expected to occur no more often than 0.1% (1 out of 1000 tests) over a sustained period of time. The same test, when run a second time, is very likely (999 out of 1000 times) to succeed.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <p>{`The first explanation is that the VM crashed. When that happens, the VM stops communicating with our OnDemand services and the VM is effectively "lost." This can happen when:`}</p>
    <ul>
      <li parentName="ul">{`The VM runs out of disk space or RAM`}</li>
      <li parentName="ul">{`There is a bug in the browser, OS, virtualization software, or combination of all three, which then causes the VM to crash`}</li>
    </ul>
    <p>{`It's difficult to reliably distinguish between these two cases automatically. The error message “internal server error” is meant to cover both of them.  `}</p>
    <p>{`Of the two causes above, the second is more common. Unfortunately, these crashes are hard to isolate much less prevent. They are usually not under our control and quite intermittent. This is the rate at which VMs and browsers crash, and crashes in those components can be triggered more or less often depending on what actions you choose to run within their tests.`}</p>
    <p>{`A second possible explanation is an infrastructure problem within Sauce's service. The state of a VM running a test is kept track of by a number of daemons and database entries, which are frequently updated. Collectively, they make up the “connection” between OnDemand and the VM. The connection can be lost if the network drops packets, the database becomes corrupt, or daemons crash.`}</p>
    <p>{`A third, very rare case is when the error can be correlated to a particular combination of requested capabilities. This happened in May 2016 with the combination of a certain screen resolution (1400x1050) and a certain OS (Windows 7) -- but only for certain tests. We no longer allow that combination to be run on our service.`}</p>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <p>{`Check the error rate over time. It is expected to occur approximately 0.1% of the time (1 out of 1000 tests). If the error rate remains below this level, add a retry for this kind of error into your Continuous Integration program. You can contact `}<a parentName="p" {...{
        "href": "mailto:help@saucelabs.com"
      }}>{`help@saucelabs.com`}</a>{` to check the error rate if it’s not easy to ascertain from your own CI program.`}</p>
    <p>{`If the error rate is over 0.1% for a short period of time, check `}<a parentName="p" {...{
        "href": "http://status.saucelabs.com/"
      }}>{`status.saucelabs.com`}</a>{` for signs of an incident at a time corresponding to the elevated error rate. Some types of incidents (but not all) will cause Internal Server Errors.`}</p>
    <p>{`If the error rate is over 0.1% for a sustained period of time (days or weeks), contact `}<a parentName="p" {...{
        "href": "mailto:help@saucelabs.com."
      }}>{`help@saucelabs.com.`}</a>{` We'll try to identify a pattern to the errors (for example, is it particular to one type of browser, OS, or test). Note that this is the least likely explanation.`}</p>
    <h2 {...{
      "id": "invalid-parent-tunnel"
    }}>{`Invalid Parent Tunnel`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`Your tests are requesting a Sauce Connect tunnel opened by one of the accounts above it in your account hierarchy. That tunnel is not available for use.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <p>{`When requesting a new Sauce Labs job, you provided the `}<inlineCode parentName="p">{`parentTunnel`}</inlineCode>{` desired capability. Sauce Labs attempted to find an account above you in your account hierarchy, running a Sauce Connect tunnel, configured to be shared with subaccounts. We did not find a matching account, for one of the following reasons:`}</p>
    <ul>
      <li parentName="ul">{`You are requesting an account that does not exist`}</li>
      <li parentName="ul">{`You are requesting an account that is not on your team or an admin account`}</li>
      <li parentName="ul">{`You are requesting an account that is not sharing any Sauce Connect tunnels`}</li>
      <li parentName="ul">{`You are requesting an account that is not running any Sauce Connect tunnels`}</li>
      <li parentName="ul">{`You are requesting an account for which Sauce Connect tunnels have been shut down (by the user `}<em parentName="li">{`or`}</em>{` an error)`}</li>
    </ul>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <p>{`Reach out to the person who administers the account that you set as the `}<inlineCode parentName="p">{`parentTunnel`}</inlineCode>{` desired capability; this person sets the tunnel sharing permissions. Ask them to confirm the following:`}</p>
    <ul>
      <li parentName="ul">{`They have an open Sauce Connect tunnel (they can check on the `}<strong parentName="li">{`Tunnels`}</strong>{` page)`}</li>
      <li parentName="ul">{`They opened a tunnel with the `}<inlineCode parentName="li">{`--shared-tunnel`}</inlineCode>{` option (see `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=48365781"
        }}>{`Sauce Connect Proxy Command-Line Quick Reference Guide`}</a>{` for more information)`}</li>
      <li parentName="ul">{`They are an Admin and/or a member of your team`}</li>
    </ul>
    <p>{`Restarting the Sauce Connect tunnel may be required.`}</p>
    <p>{`Alternatively, you can remove the `}<inlineCode parentName="p">{`parentTunnel`}</inlineCode>{` desired capability from your tests. If you need Sauce Connect to run your tests, you will need to set up an alternative tunnel.`}</p>
    <h2 {...{
      "id": "test-didnt-see-a-new-command-for-90-seconds"
    }}>{`Test Didn't See a New Command for 90 Seconds`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`You'll see this error when Sauce Labs doesn't receive a new command from your Selenium script in more than 90 seconds (the default duration for a timeout).`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <p>{`There are a couple potential causes for this error:`}</p>
    <ul>
      <li parentName="ul">{`The most common cause is that your script crashed, was** **forcefully interrupted, or you lost internet connectivity`}</li>
      <li parentName="ul">{`If your tests don't include a session ending request, such as a call to `}<inlineCode parentName="li">{`driver.quit()`}</inlineCode>{` or `}<inlineCode parentName="li">{`browser.stop()`}</inlineCode>{`, they will will keep running forever, consuming all test minutes available in your account. This error is thrown after 90 seconds as a means of preventing this.`}</li>
      <li parentName="ul">{`A less common, but still possible cause, is that your test legitimately needs more than 90 seconds to send a new command to the browser. This happens most often when a network or disk IO error occurs between Selenium API calls in your tests (for example, for DB queries, local file reads, or changes).`}</li>
    </ul>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <ul>
      <li parentName="ul">{`Make sure you have internet connectivity`}</li>
      <li parentName="ul">{`Make sure your script includes `}<inlineCode parentName="li">{`driver.quit()`}</inlineCode>{` or `}<inlineCode parentName="li">{`browser.stop()`}</inlineCode>{` to conclude the test`}</li>
      <li parentName="ul">{`If your test needs more than 90 seconds to send a new command to the browser, use the `}<inlineCode parentName="li">{`idleTimeout`}</inlineCode>{` desired capability to modify Sauce's wait time for further commands. For more information, see the `}<strong parentName="li">{`Timeouts`}</strong>{` section of `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/display/DOCS/Test+Configuration+Options"
        }}>{`Test Configuration Options`}</a>{`.`}</li>
    </ul>
    <h2 {...{
      "id": "test-exceeded-maximum-duration-of-1800-seconds"
    }}>{`Test Exceeded Maximum Duration of 1800 Seconds`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`You'll see this error when your test suite is still running in a session that has lasted more than 1800 seconds (30 minutes).`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <ul>
      <li parentName="ul">{`The most common cause for this is an infinite loop in your tests that keeps sending commands without an end clause`}</li>
      <li parentName="ul">{`Tests that run locally can take longer when run with Sauce`}</li>
    </ul>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <ul>
      <li parentName="ul">{`Check for infinite loops in your test`}</li>
      <li parentName="ul">{`If you suspect that the error is related to latency in the Sauce network or testing infrastructure, consider breaking your test suite up into `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=48365933"
        }}>{`small, autonomous, atomic tests`}</a></li>
      <li parentName="ul">{`If your test needs more than 1800 seconds to complete, you can use the `}<inlineCode parentName="li">{`maxDuration`}</inlineCode>{` desired capability to make Sauce wait longer for your test to complete. You can find more information about this desired capability in the Timeouts section of the `}<a parentName="li" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=80417492"
        }}>{`Test Configuration Options`}</a>{` topic.`}</li>
    </ul>
    <h2 {...{
      "id": "user-terminated"
    }}>{`User Terminated`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`The testing session was terminated by the user.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <ul>
      <li parentName="ul">{`Your test was manually interrupted using the `}<strong parentName="li">{`Cancel`}</strong>{` or `}<strong parentName="li">{`Breakpoint`}</strong>{` buttons in the Sauce Labs application. Since both of these take control of the virtual machine immediately, test assets like screenshots, video, or logs that require additional execution time will not be collected and made available afterwards.`}</li>
    </ul>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <ul>
      <li parentName="ul">{`Don't push the buttons!`}</li>
    </ul>
    <h2 {...{
      "id": "youve-exceeded-your-sauce-labs-concurrency-limit"
    }}>{`You've Exceeded Your Sauce Labs Concurrency Limit`}</h2>
    <p><strong parentName="p">{`Description`}</strong></p>
    <p>{`You have requested too many tests to run at the same time.`}</p>
    <p><strong parentName="p">{`Cause(s)`}</strong></p>
    <p>{`Each Sauce Labs account has a maximum number of tests it's allowed to have open at the same time. We refer to this as your concurrency. You can see your concurrency limit on your Sauce Labs.Sauce Labs will not run additional tests once you've reached your concurrency limit.`}</p>
    <p><strong parentName="p">{`Resolution`}</strong></p>
    <p>{`Run fewer tests, or `}<a parentName="p" {...{
        "href": "https://saucelabs.com/pricing"
      }}>{`upgrade your account`}</a>{` to run more.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
